function SignUn(props) {

  return (
     <section className="sign-up">
        <h2 className="sign-up__title">
            Регистрация
        </h2>
        <form className="sign-up__form">
            <input id="sign-up-email-input" name="sign-up-email" type="email" placeholder="Email" className="sign-up__input" required />
            <input id="sign-up-password-input" name="sign-up-password" type="password" placeholder="Пароль" className="sign-up__input" required />
            <button type="submit" className="sign-up__submit">Зарегистрироваться</button>
        </form>
     </section>
  );
}

export default SignIn;
